     </div>
     <div className="hero-text">
        <h1>{props.title}</h1>
        <p>{props.text}</p>
        <p>{props.text2}</p>
        <p>{}</p>
    
        
        
     </div>
     
     
    </>);
 }
 
 
 export default Hero;
